import React from 'react'
import "../styles/Posts.css";
import Stories from "./Stories"
import Post from "./Post";
import PostSender from "./PostSender";


function Posts() {
    return (
      <div className="posts">
        <Stories/>
        <PostSender/>
        <Post/>
      </div>
    );
}

export default Posts
